/* The following table maps CS-MAP ellipsoid key names with EPSG code numbers.
   The matching was accomplished by producing a combined table (.XLS) which
   included both radii in meters.  The table was sorted by the radii, and
   matching entries were combined.
   
   In the flag word, bit 0 set to 1 indicates a definition original to CS-MAP.
   If bit 0 is not set, the definition was, essentially, imported from EPSG,
   V6.3.  Bit 1 set indicates a duplicate definition internal to EPSG (does
   not occur in the ellipsoids table).  Bit 2 set indicates a bogus EPSG
   defintion (does not occur in the ellipsoid table).
   
   In producing this table, Mentors GHANA-WO was deprecated in favor of EPSG's
   WarOffice as it was clear that the EPSG definition was the better of the two.
   
   Also note, the the CS_MAP dictionary includes several ellipsoids which do
   not appear in the EPSG database and, therefore, do not have an EPSG Code
   number; and are not included in the table below.  The mapping functions
   will return a zero in this case.
   
   The comments in each entry are the EPSG Name field extracted from EPSG
   database V6.3.  The extraction was done by automatic means based on the
   EPSG code value in the table, after the matching and reduction process.
   Therefore, compariaon of the CS-MAP names in the table proper, and the
   EPSG names in the comments, are a reliable way of evaluating the accuracy
   of the table.  Sorry about the C++ comment sequence, but I don't think
   there are too many compilers around any more that can't handle them.
*/

