/* The following table maps CS-MAP coordinate system key names with EPSG code
   numbers.  The matching was accomplished by producing a combined table
   (.XLS) which included:
   
   1> referenced datum,
   2> projection type,
   3> central meridian.
   
   matching entries were sorted in the order indicated above, and the matching
   entries identified and combined manually.  This being accomplished in an
   Excel spreadsheet.  The datum names used for comparison purposes were
   obtained from the above datum table to remove ambiguity. 
   
   In the flag word, bit 0 set to 1 indicates a definition original to CS-MAP.
   If bit 0 is not set, the definition was, essentially, imported from EPSG,
   V6.3.  Bit 1 set indicates a duplicate definition internal to EPSG.  That
   is, two distinct EPSG code values refer to the same coordinate system
   defintion, and thus have the same CS_MAP name.  In these cases, we always
   list the preferred EPSG code value first, so when converting from CS-MAP
   name to EPSG code, that is the value you will get.  Bit 2 set indicates a
   bogus EPSG defintion.  That is, an entry for which the CS-MAP name
   represents a valid coordinate system definition, but the EPSG code
   identifies a bogus definition in the EPSG V6.3 database.
   
   In generating shorter (23 character max) MSI names for coordinate systems
   imported from EPSG, the following techniques was generally used:
   
   1> The short version, or a shortened version, of the datum name is given
      first.
   2> A period character separates the datum name from the coordinate system
      identifier.
   3> The coordinate system is usually identifed by a abreviated type,
      followed by any zone identification required.  A hyphen is used to
      separate the coordinate system type from the zone.
   4> Only where necessary, a unit identification is appended to the end
      of the name; a persiod separating the unit indetification from the
      rest of the name.
   5> Certain abbreviations are widely used:
		GK    --> Gauss Kruger
		GK3d  --> Gauss Kruger three degree zone
		LL    --> Type of all geographic coordinate systems.
		Cntrl --> Central

   All previously existing CS-MAP coordinate system key names remain
   unchanged, except perhaps an occasional change in case which is
   purely cosmetic as all key name searches are NOT case sensitive.
   
   Also note, the the CS_MAP dictionary includes several coordinate systems
   which do not appear in the EPSG database and, therefore, do not have an
   EPSG Code number; and are not included in the table below.  The mapping
   functions will return a zero in this case.
   
   The comments in each entry are the EPSG Name field extracted from EPSG
   database V6.3.  The extraction was done by automatic means based on the
   EPSG code value in the table, after the matching and reduction process.
   Therefore, comparision of the CS-MAP names in the table proper, and the
   EPSG names in the comments, are a reliable way of evaluating the accuracy
   of the table.  Sorry about the C++ comment sequence, but I don't think
   there are too many compilers around any more that can't handle them.
*/

